import React from 'react';

export default function Navbar(){

    return(
        <div className='navbar'>
            <h1 className='h11'>Fun facts about React</h1>
            <ul >
            <li>born in 2013</li>
            <li>jordan walk</li>
            <li>over than 100k</li>
            <li> facebook maintainted</li>
            <li>including mobile</li>
            </ul>
        </div>
    )
}
